function invert(bytes) {
    const buffer = new Uint8Array(bytes.buffer)
    const result = new Uint8Array(buffer.length - 2)

    for (let i = 0; i < result.length; i += 2) {
        result[i] = (~buffer[buffer.length - 3 - i - 1]) & 0xFF
        result[i + 1] = (~buffer[buffer.length - 3 - i]) & 0xFF
    }

    return new Uint16Array(result.buffer)
}

